  //   },

  //   {
  //     field: 'image',
  //     headerName: "Meninggal",
  //     width: 150,
  //   },
  //   {
  //     field: "status",
  //     headerName: "Status",
  //     width: 120,
  //     renderCell: (params) => {
  //       return (
  //         <div className={`cellWithStatus ${params.row.status}`}>
  //           {params.row.status}
